def parse_data(data_str):
    frames = []
    current_frame = []
    current_result = None  # 현재 결과 값을 저장할 변수

    for line in data_str.split('\n'):
        if line.startswith('Results:'):
            if current_frame:
                frames.append((current_frame, current_result))
                current_frame = []
            current_result = line.split(':')[1].strip()  # 결과 값 추출
        else:
            current_frame.extend([float(value) for value in line.split()])

    if current_frame:  # 마지막 프레임 추가
        frames.append((current_frame, current_result))

    return frames

def show_frames(frames):
    for i, (frame, result) in enumerate(frames):
        array = np.array(frame).reshape((24, 32, 1))  # 24x32 크기로 변환
        plt.imshow(array, cmap='gray')  # 그레이스케일 이미지로 표시
        plt.title(f'Frame {i+1} - Result {result}')
        plt.colorbar()
        plt.show()

# 데이터 파싱
frames = parse_data(data)

# 프레임 표시
show_frames(frames)
